        //                 info.events[i].description = response[i];
        //             }
        //             callback(info);
        //         });
        //     }
        //     var response = rpc.batch(txList);
        //     for (i = 0; i < response.length; ++i) {
        //         info.events[i].description = response[i];
        //     }
        // }
